import React from 'react';
import { NavLink } from 'react-router-dom';
import { PRODUCTS_ROUTE, REGISTRATION_ROUTE, SHOP_ROUTE } from '../../utils/consts';
import styles from './shop.module.scss'

const ProductItem = (props) => {
    let productsPage = props.productsPage;

    return (
        <div className={styles.productsItem}>
            <NavLink className={styles.productLink} to={REGISTRATION_ROUTE}>
                <img src="https://chitatel.by/storage/thumbs/b0/h1001_w1001_b0cdeabbb5751fa076c466a6fd9f07d9.jpg" alt="/" />
            </NavLink>
            <div className={styles.productsName}>
                <NavLink to={REGISTRATION_ROUTE}>
                    {productsPage.name}
                </NavLink>
                <div className={styles.productAuthor}>Ли Бардуго</div>
            </div>
        </div>
    )
}

export default ProductItem;
